import React, { useState, useEffect } from "react";
import "./App.css";

const baseURL = "http://localhost:3003";

const App = () => {
  const [bookmarks, setBookmarks] = useState([]);

  const getBookmarks = () => {
    fetch(baseURL + "/tasks")
      .then((res) => {
        if (res.status === 200) {
          return res.json();
        } else {
          return [];
        }
      })
      .then((data) => {
        setBookmarks(data);
      });
  };

  useEffect(() => {
    getBookmarks();
  }, []);

  return (
    <div className="App">
      <h1>Daily Task Manager</h1>
    </div>
  );
};

export default App;
